import React from "react";
import "./Signup.css";
import axios from 'axios';
import Vaalidation from "./SignupValidation.jsx";
import {Link, useNavigate} from 'react-router-dom';
import { useState,useEffect } from "react";
import MenuIcon from '@mui/icons-material/Menu';
function Signup() {
    const navigate= useNavigate();
    const[values,setValues]=useState({
        email:'',
        password:''
    })
    const [errors,setErrors]=useState({})
    const handleSubmit=(event)=>{
        event.preventDefault();
        setErrors(Vaalidation(values));
    };
    useEffect(() => {
        if (Object.keys(errors).length === 0) {
          axios.post('http://localhost:8081/signup', values)
            .then(res => {
              navigate('/login');
            })
            .catch(err => console.log(err));
        }
      }, [errors]);
    const handleInput=(event)=>{
        setValues(prev=>({...prev,[event.target.name]: event.target.value}))
    }


    const [isMenuOpen, setIsMenuOpen] = useState(false);
    const toggleMenu = () => {
        setIsMenuOpen(!isMenuOpen);
      };
    const year = new Date().getFullYear();
    const [isActive,setisActive]=useState(false);
    return (
      <div>
        <div className="home-container">
            <div className="menu">
                <button className="menu-btn" onClick={toggleMenu}>
                    <MenuIcon/>
                </button>
                {isMenuOpen && (
                    <div className="dropdown">
                    <button className="menu-item">Contact</button>
                    <button className="menu-item">About Us</button>
                    </div>
                )}
            </div>
            <div className="tit">
                <h2><img src="/images/f3.png" alt=""/>FOOD NETWORK</h2>
            </div>
            <div className="buttons-container">
                <button className="log-btn">Login</button>
                <button className="sig-btn">Sign Up</button>
            </div>
        </div>
        <div className="sig-area">
            <form action="" onSubmit={handleSubmit}>
                <h3 className="ye">Sign Up</h3>
                <div className="drop">
                    <div className="d-btn" onClick={(e) => setisActive(!isActive)}>Choose one
                    </div>
                    {isActive &&(
                        <div className="d-con">
                            <div className="typ">Buyer
                            </div>
                            <div className="typ">Donor
                            </div>
                        </div>
                    )}
                </div>
                <div>
                    <input type="email" placeholder="Email" name="email" onChange={handleInput}/>
                    {errors.email && <span className="text-danger">{errors.email}</span>}
                </div>
                <div>
                    <input type="password" placeholder="Password" name="password" onChange={handleInput}/>
                    {errors.password && <span className="text-danger">{errors.password}</span>}
                </div>
                <Link to="\login">
                    <p className="ye">Already have an account?</p>
                </Link>
                <div>
                    <button type="submit">Sign up</button>
                </div>
            </form>
        </div>




        <div className="footer1">
            <h3>Copyright ⓒ {year}</h3>
        </div>
      </div>
    );
  }
  
  export default Signup;
